import React,{useEffect, useState} from "react";
// import { StatusBar } from "expo-status-bar";
import {
  StyleSheet,
  Text,
  View,
  Image,
  ImageBackground,
  StatusBar
} from "react-native";
import Searchbar from "./components/Searchbar";
import { Ionicons, Entypo } from "@expo/vector-icons";
import { Feather } from "@expo/vector-icons";


const im = require("./assets/sun.png");
const image = require("./assets/background_clear.jpg");
export default function App() {

 //declaring all the state variables
 const [weather, setWeather] = useState([]);
 const [temp, setTemp] = useState([]);
 const [wind, setWind] = useState([]);
 const [cloud, setCloud] = useState([]);
 const [humidity,setHumidity] = useState([]);
 const [isLoading, setIsLoading] = useState(false);
 //quotes funcions
 const randomQuote = () => {
   setIsLoading(true);
   fetch("https://api.openweathermap.org/data/2.5/weather?q=kol&appid=fa9e65bbcec2dadc812d17d6b057a746")
     .then((res) => res.json())
     .then((result) => {
       console.log(result.weather[0].description);
       setTemp(parseInt(result.main.temp - 273));
       setWeather(result.weather[0].main);
       setHumidity(result.main.humidity)
      //  console.log(parseInt(weather));

       setIsLoading(false);
     });
 };
 useEffect(() => {
  randomQuote();
}, [])

  return (
    <View style={styles.container}>
      <ImageBackground
        source={image}
        resizeMode="cover"
        style={{
          width: "100%",
          height: "100%",
          alignItems: "center",
        }}
      >
        <Searchbar/>
        <View
          style={{
            width: "100%",
            flexDirection: "column",
            alignItems: "center",
            padding: 15,
            marginTop:20,
          }}
        >
          <View
            style={{
              flexDirection: "row",
              alignItems: "center",
              justifyContent: "center",
              marginTop: 10,
            }}
          >
            <Ionicons
              name="location-outline"
              size={12}
              color="white"
              style={{ padding: 5 }}
            />
            <Text style={{ fontSize: 14,color:"white",alignSelf:"center" }}>Kolkata, India</Text>
          </View>

          <View style={{ marginTop: 30 }}>
            <Image
              style={{ width: 150, height: 150, padding: 40 }}
              source={im}
            />
          </View>
          <View
            style={{
              marginTop: 10,
              flexDirection: "row",
              padding: 10,
              alignSelf: "center",
            }}
          >
            <Text style={{ fontSize: 75, color: "white" }}>{temp}</Text>
            <Entypo
              name="circle"
              size={14}
              color="white"
              style={{ marginTop: 10, padding: 5 }}
            />
            <Text style={{ fontSize: 50, marginTop: 25, color: "white" }}>
              C
            </Text>
          </View>
          <View
            style={{
              padding: 10,
              marginTop: -20,
              marginBottom: 10,
              alignItems: "center",
            }}
          >
            <Text
              style={{ alignSself: "center", color: "white", fontSize: 30 }}
            >
           {weather}
            </Text>
            <Text style={{ alignSelf: "center", fontSize: 14, color: "white" }}>
              Friday, 4th November
            </Text>
          </View>
          <View
            style={{
              width: "90%",
              // backgroundColor: "red",
              flexDirection: "row",
              justifyContent: "space-evenly",
             alignItems:"center",
              padding: 10,
              //  borderWidth:2,
               borderTopWidth:1,
               borderColor:"white",
               marginTop:15
            }}
          >
            <View style={{ flexDirection: "column", alignItems: "center",padding:10,width:"33%"}}>
              <Feather name="cloud-rain" size={35} color="white" style={{alignSelf:"center"}}/>
              <Text style={{marginTop:5,color:"white"}}>90%</Text>
              <Text style={{marginTop:5,color:"white"}}>Wet Pows</Text>
            </View>
            <View style={{ flexDirection: "column", alignItems: "center",padding:10,width:"33%" }}>
              <Feather name="wind" size={35} color="white"  style={{alignSelf:"center"}} />
              <Text style={{marginTop:5,color:"white"}}>35 km/hr</Text>
              <Text style={{marginTop:5,color:"white"}}>Windy Fur</Text>
            </View>
            <View style={{ flexDirection: "column", alignItems: "center",padding:10,width:"33%" }}>
              <Feather name="sun" size={35} color="white"  style={{alignSelf:"center"}}/>
              <Text style={{marginTop:5,color:"white"}}>{humidity} %</Text>
              <Text style={{marginTop:5,color:"white"}}>Humidity</Text>
            </View>
          </View>
        </View>
      </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "blue",
    maxHeight: "100%",
    marginTop: StatusBar.currentHeight,
    height:"100%",
  },
});
